import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import Home from './Home';
import Blog from './Blog';
import * as serviceWorker from './serviceWorker';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


// import {IndexRoute} from 'react-router';

import {
  Button,
  Navbar,
  Nav,
  Form,
  FormControl
} from "react-bootstrap";

import "bootstrap/dist/css/bootstrap.min.css";


ReactDOM.render(
  <Router>
      <Navbar bg="clear" variant="light" sticky="top" expand="sm">
        <Navbar.Brand className="Navbar-brand"><Link to="/home" style={{color:"black"}}>
          Scova Foundation
          </Link>
        </Navbar.Brand>
        <Nav className="mr-auto">
        <Link to="/book" style={{color:"black"}}>
          <Button variant="success" className="Button">
            Book
          </Button>
          </Link>
          {"   "}
          <Link to="/blog" style={{color:"black"}}>
          <Button variant="warning" className="Button">
            Blog
          </Button>
          </Link>
        </Nav>
        <Form inline  expand="sm">
          <FormControl
            type="text"
            placeholder="Search Scova"
            className="mr-sm-1"
            style={{ textAlign: "center" }}
          />
          <Button variant="dark">Search</Button>
        </Form>
      </Navbar>

      {/* <IndexRoute component={Home} /> */}

      <Route exact path="/" component={Home}/>
      <Route path="/home"> {/* {"/" | "/home"}> */}
        <Home />
      </Route>
      <Route path="/book"> {/* {"/" | "/home"}> */}
        <App />
      </Route>
      <Route path="/blog">
        <Blog />
      </Route>
    </Router>,
  document.getElementById("root")
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
